JP_Tilemap_RegularMessageBoxes:
.Main:
;$82BE10

.DATA_82BE10:									; Note: "Grant... Touch the fence for a free life!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82BE10.bin"

.DATA_82C040:									; Note: "Grant... Shut down the power in the utility shed!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82C040.bin"

.DATA_82C27E:									; Note: "Hi Grant... Spitters will not hurt you. Their spit gives you more power!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82C27E.bin"

.DATA_82C4CA:									; Note: "SUCKER!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82C4CA.bin"

.DATA_82C6C2:									; Note: "Hey Grant... Raptors will not attack unless you shoot at them!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82C6C2.bin"

.DATA_82C904:									; Note: "Grant... Raptors are breeding! Collect all their eggs or they will hatch!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82C904.bin"

.DATA_82CB3E:									; Note: ""YOUR TASK... Turn on the generator in the Nublar utility shed!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82CB3E.bin"

.DATA_82CD5E:									; Note: "Secure the visitor center!Find out how the raptors get in and stop them!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82CD5E.bin"

.DATA_82CF92:									; Note: "Well done Grant! The visitor center is now free of raptors!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82CF92.bin"

.DATA_82D1B6:									; Note: "Grant... The T-rex can only be tranquilized Bullets and missles are useless!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82D1B6.bin"

.DATA_82D400:									; Note: "Great shot Grant!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82D400.bin"

.DATA_82D602:									; Note: "Good shooting Grant!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82D602.bin"

.DATA_82D802:									; Note: "YOUR TASK... Clear the ship of dinosaurs! Access a terminal to stop it from sailing!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82D802.bin"

.DATA_82DA5A:									; Note: "YOUR TASK... Destroy the raptor nest in the east forest. Use the nerve gas!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82DA5A.bin"

.DATA_82DC9A:									; Note: "Thats it Grant.The gas bomb will go off automatically. Get out of there quickly!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82DC9A.bin"

.DATA_82DEDA:									; Note: "Alan... Be careful around blind corners. The T-Rex is free!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82DEDA.bin"

.DATA_82E104:									; Note: "Alan... The pachyce-phalosaurus are very territorial. Stay out of their way!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82E104.bin"

.DATA_82E344:									; Note: "Good Alan... The ship is now free of raptors!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82E344.bin"

.DATA_82E568:									; Note: "YOUR TASK... Use the ship terminal to contact the mainland for help!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82E568.bin"

.DATA_82E7A4:									; Note: "YOUR TASK... Reboot the computer in the visitor center!"
	incbin "Tilemaps/Compressed/RegularMessageBox/DATA_82E7A4.bin"

